INSERT INTO `yss_content` (`id`, `page`, `position`, `layout`, `title`, `detail`, `pic`, `pic_title`, `lang`, `sort_order`, `date_create`, `date_update`) VALUES
	(4, 4, 'section1', 'RIGHT_PIC', 'YSS สู่ความเชื่อมั่นทีมงาน R&D', '<p>YSS ผู้ผลิตและพัฒนาโช้คอัพรถยนต์และรถมอเตอร์ไซค์มากว่า 30 ปี โดยใช้เทคโนโลยีและอุปกรณ์ที่ทันสมัย มีการพัฒนาและปรับปรุงผลิตภัณฑ์อย่างต่อเนื่อง ทำให้ในทุกขั้นตอนของการผลิตมีคุณภาพสูง พร้อมทั้งมีทีมงาน R&D มากประสบการณ์จากยุโรปที่พัฒนาโช้คอัพเพื่อใช้ในการแข่งขันในรายการระดับโลกมาอย่างมากมาย คอยมุ่งมั่นพัฒนาสินค้า และบุคลากรของเราอย่างต่อเนื่อง ทำให้สินค้าทุกชิ้นมีคุณภาพทัดเทียมยุโรป รวมถึงขั้นตอนการนำโช้คอัพไปทดสอบประสิทธิภาพการใช้งาน การติดตั้ง ความทนทานและความปลอดภัยทีม R&D ใส่ใจในทุกขั้นตอนทำให้คุณภาพสินค้าของ</p>\r\n\r\n<p>YSS ได้รับการรับรองมาตรฐานสินค้า จากสถาบัน Kraftfahrt-Bundesamt (KBA)- Federal Motor Transport Authority จากประเทศเยอรมัน ซึ่งเป็นแบรนด์เดียวในเอเซียที่ผ่านการรับรองนี้ และผ่านการทดสอบมาตรฐานสินค้า ABE จากประเทศเยอรมัน นอกจากนี้ สินค้าของ YSS ผ่านมาตรฐานอุตสาหกรรมยานยนต์มากมาย เช่น  QS9000, ISO/TS16949, ISO9001 จาก TUV RHEILAND รวมถึงเทคโนโลยที่คิดค้นขึ้นเองอย่าง VVSC,VBSC อีกด้วย</p>', '20151028075433.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'TH', 1, '2015-10-28 07:54:33', '2015-10-30 07:10:29'),
	(5, 4, 'section1', 'RIGHT_PIC', 'YSS team confidence to R & D.', '<p>YSS is a shock absorber manufacturer for cars and motorcycles for more than 30 years. YSS continues using advanced technology and equipment at all stages of the production to develop and improve high quality of products continuously. Also, YSS has R & D team from Europe that has a lot of experience for developing shock absorber in order to compete in the global wide. All products made with quality equivalent to European quality including the shock absorber performance, installation, durability, and safety testing. R & D team cares every step to make YSS products to meet customer satisfaction. <p>\r\n\r\n<p>YSS received certification from the Institute Kraftfahrt-Bundesamt (KBA) - Federal Motor Transport Authority of Germany which is the only brand in ASEAN that has been certified. Additionally, YSS was certified in various automotive industries such as QS9000, ISO / TS16949, ISO9001 from TUV RHEILAND.</p>', '20151028080016.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 1, '2015-10-28 08:00:16', '2015-10-30 07:16:26'),
	(6, 4, 'section2', 'LEFT_PIC', '', 'YSS ยังปลูกฝังจิตสำนึกให้พนักงานในองค์กร ใส่ใจในการรักษาสิ่งแวดล้อมทั้งภายใน และภายนอกชุมชนพร้อมกับปรัชญาในการผลิตโช้คอัพที่ว่า “เราต้องคิดอยู่เสมอว่า เรากำลังผลิตโช้คอัพให้กับตัวเองและครอบครัว”', '20151028083510.jpg', '“เราต้องคิดอยู่เสมอว่า เรากำลังผลิตโช้คอัพให้กับตัวเองและครอบครัว”', 'TH', 2, '2015-10-28 08:35:10', '2015-10-30 07:11:57'),
	(7, 4, 'section2', 'LEFT_PIC', '', 'YSS is also cultivate all staffs awareness to pay attention to the environment both internal and external communities with its philosophy of producing a shock absorber that "We have always thought that we are producing a shock absorber to myself and my family”.', '20151028083831.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 2, '2015-10-28 08:38:31', '2015-10-30 07:15:25'),
	(8, 6, 'section1', 'RIGHT_PIC', 'คุณภาพระดับโลก', 'Shock you can trust. Our shocks have met ABE product standard from Germany and are produced in the process certified under ISO 9001.', '20151028085711.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'TH', 1, '2015-10-28 08:57:11', '2015-10-30 06:09:21'),
	(9, 6, 'section1', 'RIGHT_PIC', 'World Class Quality', 'Shock you can trust. Our shocks have met ABE product standard from Germany and are produced in the process certified under ISO 9001.', '20151028085821.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 1, '2015-10-28 08:58:21', '2015-10-30 09:07:53'),
	(10, 7, 'section1', 'TOP_PIC', 'ความรับผิดชอบต่อสังคม', 'บริษัท วาย.เอส.เอส (ประเทศไทย) จำกัด ได้ตระหนักถึงความสำคัญในการอยู่ร่วมกันของคนในสังคม และบริษัทได้มีกิจกรรมสนับสนุนและพัฒนาชุมชนทั้งทางด้านการศึกษา การร่วมแรงร่วมใจในการทำความสะอาดชุมชน การรณรงค์ต้านยาเสพติด ฯลฯ ซึ่งได้รับความร่วมมือของคนในชุมชนเป็นอย่างดี', '20151028091632.jpg', 'มอบทุนการศึกษาให้นักเรียน', 'TH', 1, '2015-10-28 09:16:32', '2015-10-30 08:59:13'),
	(11, 7, 'section1', 'TOP_PIC', 'Corporate Social Responsibility', 'Corporate Social Responsibility', '20151028092418.jpg', 'Corporate Social Responsibility', 'EN', 1, '2015-10-28 09:24:18', '2015-10-30 08:59:38'),
	(12, 5, 'section1', 'RIGHT_PIC', 'Milestone : YSS (Thailand) Co., Ltd.', '<p class="history01">\r\n      <span class="dropcap2">1983</span>\r\n       Was established at Prapadaeng district, Samutprakarn province.\r\n</p>\r\n\r\n<p class="history01">\r\n        <span class="dropcap2">2005</span>\r\n         Joint venture with R&amp;D team from Europe to develop product and improve technology.\r\n</p>\r\n\r\n<p class="history01">\r\n         <span class="dropcap2">2007</span>\r\n        Established R&amp;D center name YSS Europe BV at Schijndel,Holland.\r\n</p>\r\n\r\n<p class="history01">\r\n                  <span class="dropcap2">2008</span>\r\n                  Only one shock brand in Asia has achieved the Quality certificate by ABE Kraftfahrt – Bundesant institute from Germany.\r\n</p>\r\n\r\n<p class="history01">\r\n                 <span class="dropcap2"> 2010</span>\r\n                  2 millions shock absorber per year in new factory and full of high technology machine that cover more than 30 countries.\r\n</p>\r\n\r\n<p class="history01">\r\n                  <span class="dropcap2">2013</span>\r\n                  Proud to emerge cars high performance shock absorber with YSS International standard\r\n</p>', '20151028094350.png', 'We serve the world, We provide the best', 'TH', 1, '2015-10-28 09:43:50', '2015-10-30 09:11:28'),
	(13, 5, 'section1', 'RIGHT_PIC', 'Milestone : YSS (Thailand) Co., Ltd.', '<p class="history01">\r\n      <span class="dropcap2">1983</span>\r\n       Was established at Prapadaeng district, Samutprakarn province.\r\n</p>\r\n\r\n<p class="history01">\r\n        <span class="dropcap2">2005</span>\r\n         Joint venture with R&amp;D team from Europe to develop product and improve technology.\r\n</p>\r\n\r\n<p class="history01">\r\n         <span class="dropcap2">2007</span>\r\n        Established R&amp;D center name YSS Europe BV at Schijndel,Holland.\r\n</p>\r\n\r\n<p class="history01">\r\n                  <span class="dropcap2">2008</span>\r\n                  Only one shock brand in Asia has achieved the Quality certificate by ABE Kraftfahrt – Bundesant institute from Germany.\r\n</p>\r\n\r\n<p class="history01">\r\n                 <span class="dropcap2"> 2010</span>\r\n                  2 millions shock absorber per year in new factory and full of high technology machine that cover more than 30 countries.\r\n</p>\r\n\r\n<p class="history01">\r\n                  <span class="dropcap2">2013</span>\r\n                  Proud to emerge cars high performance shock absorber with YSS International standard\r\n</p>', '20151028094443.png', 'We serve the world, We provide the best', 'EN', 1, '2015-10-28 09:44:43', '2015-10-30 09:23:42'),
	(14, 5, 'section2', 'LEFT_PIC', 'The Philosophy of YSS', '<p><span class="dropcap2">The</span> Philosophy of YSS is “We produce shock absorber for ourselves and our family”, YSS use International standard quality system to control and manage our production for the best quality in every piece of the product. From present to the future,  we strive to develop new technology for the best quality suspension and provide to our customer continuously covering the product for car, motorcycle, scooter, ATV and UTV.</p>\r\n\r\n<h2 class="yssfont01">Vision</h2>\r\n<p>We are the leadership in development and manufacturing of world class suspension, continuous innovating quality products with whole of technology, performance and value for our customers.</p>\r\n\r\n<h2 class="yssfont01">Mission</h2>\r\n<p>We produce high performance and more value suspension through advance technology and equipment with well-trained full skill and active teams. We also have service centers to provide worldwide customers. Furthermore, we have quality system and social responsibility to ensure that YSS is the world class suspension.\r\n                </p>', '20151028095218.jpg', 'We produce shock absorber for ourselves and our family', 'TH', 2, '2015-10-28 09:52:18', '2015-10-30 09:17:04'),
	(15, 5, 'section2', 'LEFT_PIC', 'The Philosophy of YSS', '<p><span class="dropcap2">The</span> Philosophy of YSS is “We produce shock absorber for ourselves and our family”, YSS use International standard quality system to control and manage our production for the best quality in every piece of the product. From present to the future,  we strive to develop new technology for the best quality suspension and provide to our customer continuously covering the product for car, motorcycle, scooter, ATV and UTV.</p>\r\n\r\n<h2 class="yssfont01">Vision</h2>\r\n<p>We are the leadership in development and manufacturing of world class suspension, continuous innovating quality products with whole of technology, performance and value for our customers.</p>\r\n\r\n<h2 class="yssfont01">Mission</h2>\r\n<p>We produce high performance and more value suspension through advance technology and equipment with well-trained full skill and active teams. We also have service centers to provide worldwide customers. Furthermore, we have quality system and social responsibility to ensure that YSS is the world class suspension.\r\n                </p>', '20151028095325.jpg', 'We produce shock absorber for ourselves and our family', 'EN', 2, '2015-10-28 09:53:25', '2015-10-30 09:15:07'),
	(16, 10, 'section1', 'RIGHT_PIC', 'การติดตั้งโช้คอัพ', 'การติดตั้งโช้คอัพ ท่านสามารถนำรถของท่านเข้ามาทำการติดตั้งโดยผู้ชำนาญงานโดยเฉพาะที่โรงงานของเราได้ทุกวัน จันทร์-ศุกร์ เวลา 9.00 - 18.00 น. หรือสอบถามได้ที่ 02-706-3700,\r\n02-763-8600 ', '20151028101144.jpg', 'ติดตั้งโช้คอัพโดยช่างผู้เชี่ยวชาญ', 'TH', 1, '2015-10-28 10:11:44', '2015-10-30 09:33:19'),
	(17, 10, 'section1', 'RIGHT_PIC', 'Setup & Install', 'Setup & Install detail detail detail detail...', '20151028101308.jpg', 'We have always thought that we are producing a shock absorber to myself and my family', 'EN', 1, '2015-10-28 10:13:08', '2015-10-30 09:31:02'),
	(18, 11, 'section1', 'RIGHT_PIC', 'การรับประกัน', 'รายละเอียดการรับประกันสินค้า', '20151029031052.png', 'บรรยายใต้ภาพ', 'TH', 1, '2015-10-29 03:10:52', '2015-10-30 09:26:54'),
	(19, 11, 'section1', 'RIGHT_PIC', 'Warranty', 'detail detail detail detail detail detail detail detail detail detail detail detail', '20151029031228.png', 'under pic detail', 'EN', 1, '2015-10-29 03:12:28', '2015-10-30 09:27:23'),
	(20, 14, 'section1', 'RIGHT_PIC', 'ซัพพอร์ต', 'รายละเอียดเกี่ยวกับซัพพอร์ต', '20151029051738.jpg', 'คำบรรยายใต้ภาพ', 'TH', 1, '2015-10-29 05:17:38', '2015-10-30 09:32:29'),
	(21, 14, 'section1', 'RIGHT_PIC', 'Support', 'support detail support detail detail detail', '20151029052008.jpg', 'test description', 'EN', 1, '2015-10-29 05:20:08', '2015-10-30 09:31:37'),
	(23, 20, 'section1', 'TOP_PIC', 'Service Center "YSS" make over "smile"', '<span class="dropcap2">YSS</span> is a shock absorber manufacturer for cars and motorcycles for more than 30 years. \r\nYSS continues using advanced technology and equipment at all stages of the production to \r\ndevelop and improve high quality of products continuously. YSS has dealers in more than 30 \r\ncountries around the world to offer the best service with a professional and well-trained Service \r\nCenter team.\r\n', '20151030103219.jpg', 'Service Center', 'EN', 1, '2015-10-30 10:32:19', '2015-10-30 10:37:03'),
	(24, 20, 'section1', 'TOP_PIC', 'Service Center “YSS” ให้มากกว่า“รอยยิ้ม”', '<span class="dropcap2">YSS</span> ผู้ผลิตและพัฒนาโช้คอัพรถมอเตอร์ไซค์มากกว่า 30 ปี ด้วยเทคโนโลยีและอุปกรณ์ที่ทันสมัย  มีการพัฒนาและปรับปรุงผลิตภัณฑ์อย่างต่อเนื่อง YSS ยังมีตัวแทนจำหน่ายมากกว่า 30 ประเทศทั่วโลก   มีศูนย์ Service Center ที่คอยให้บริการแก่ลูกค้าด้วยทีมงานมืออาชีพ และผ่านการฝึกอบรมมาเป็นอย่างดี  โดยให้บริการทั้งในด้านการให้คำแนะนำ กรณีที่ลูกค้านำรถมาซ่อมโช้คอัพหรือติดตั้งโช้คอัพใหม่ มีห้องรับรองเพื่ออำนวยความสะดวกให้แก่ลูกค้าระหว่างรอ มีการทดสอบรถภายหลังจากการซ่อมหรือติดตั้งโช้คอัพเสร็จ รวมถึงมีบริการหลังการขายที่เปี่ยมไปด้วยความจริงใจของพนักงานYSS อีกด้วย ', '20151030103426.jpg', 'Service Center', 'TH', 1, '2015-10-30 10:34:26', '2015-10-30 11:04:18'),
	(25, 20, 'section2', 'RIGHT_PIC', '', 'ทั้งนี้ ศูนย์ Service Center สามารถซ่อมโช้คอัพรถมอเตอร์ไซค์ รถสกูตเตอร์ รถบิ๊กไบท์ และรถUTV โดยมีศูนย์บริการมากถึง 11 ศูนย์ ในต่างประเทศ ส่วนในประเทศไทย มีศูนย์ Service Center อยู่ที่ถนน เทพารักษ์ อ.บางพลี จ.สมุทรปราการ โดยทุกศูนย์ ใช้มาตรฐานเดียวกันเพื่อให้ลูกค้าของ YSS เกิดความประทับใจในงานบริการและเกิดความเชื่อมั่นต่อตัวสินค้า YSS มากขึ้น  ', '20151030110756.jpg', '', 'TH', 2, '2015-10-30 11:06:20', '2015-10-30 11:07:56'),
	(26, 20, 'section2', 'RIGHT_PIC', '', '<p>We provide customer with a complete service in terms of giving advice, repair and install \r\nthe car\'s shock absorber as well as after-sales service to bursting with sincerity of YSS.</p>\r\n\r\n<p>\r\nThe Service Center provide the most professional facility for all kinds of vehicle: Motorbikes, scooters, cars, Big Bike and UTV by a service team up to 11 service centers around the globe. All service centers use the same standard to give YSS customers impression and satisfaction in service and confidence in YSS product.\r\n</p>\r\n', '20151030110944.jpg', '', 'EN', 2, '2015-10-30 11:09:44', NULL),
	(27, 20, 'other', 'ONLY_TEXT', 'Service Center “YSS” ให้มากกว่า“รอยยิ้ม”', 'YSS ผู้ผลิตและพัฒนาโช้คอัพรถมอเตอร์ไซค์มากกว่า 30 ปี ด้วยเทคโนโลยีและอุปกรณ์ที่ทันสมัย    มีการพัฒนาและปรับปรุงผลิตภัณฑ์อย่างต่อเนื่อง YSS ยังมีตัวแทนจำหน่ายมากกว่า 30 ประเทศทั่วโลก   มีศูนย์ Service Center ที่คอยให้บริการแก่ลูกค้าด้วยทีมงานมืออาชีพ และผ่านการฝึกอบรมมาเป็นอย่างดี ', NULL, '', 'TH', NULL, '2015-10-30 11:33:49', NULL);
