	(3, 'H', 'HYDRAULIC SPRING  PRELOAD', 'ปรับแบบไฮดรอลิก ไม่มีสาย'),
	(4, 'H1', 'HYDRAULIC SPRING PRELOAD CABLE', 'ปรับแบบไฮดรอลิก มีสาย'),
